import React, { useState, useEffect } from 'react';

const FichaOrtodoncia = ({ data = {}, onUpdate }) => {
  const [form, setForm] = useState({
    ...data,
    controles: data.controles || []
  });
  const [selectedControl, setSelectedControl] = useState(null);

  useEffect(() => {
    setForm({
      ...data,
      controles: data.controles || []
    });
  }, [data]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setForm((prev) => ({ ...prev, [name]: value }));
  };

  const handleControlChange = (index, value) => {
    const updated = [...form.controles];
    updated[index] = value;
    setForm((prev) => ({ ...prev, controles: updated }));
  };

  const handleAddControl = () => {
    setForm((prev) => ({
      ...prev,
      controles: [...prev.controles, ""]
    }));
  };

  const handleDeleteControl = (index) => {
    const updated = [...form.controles];
    updated.splice(index, 1);
    setForm((prev) => ({ ...prev, controles: updated }));
    setSelectedControl(null);
  };

  const handleSave = () => {
    if (onUpdate) {
      onUpdate(form);
      alert('âœ… Ficha ortodoncia guardada correctamente');
    }
  };

  return (
    <div className="bg-white p-4 rounded-lg shadow space-y-4">
      <h3 className="text-lg font-semibold">Ficha Ortodoncia</h3>

      {/* Datos principales */}
      {['maloclusion', 'planTratamiento', 'duracion'].map((field) => (
        <div key={field}>
          <label className="block text-sm font-medium capitalize">{field}</label>
          <input
            type="text"
            name={field}
            value={form[field] || ""}
            onChange={handleChange}
            className="w-full border px-2 py-1 rounded"
          />
        </div>
      ))}

      {/* Lista de controles */}
      <div>
        <label className="block text-sm font-medium">Controles</label>
        {form.controles.length === 0 && (
          <p className="text-sm text-gray-500 italic">No hay controles registrados.</p>
        )}
        <ul className="space-y-2">
          {form.controles.map((ctrl, i) => (
            <li
              key={i}
              className="bg-gray-100 p-2 rounded shadow flex justify-between items-center"
            >
              <span className="text-sm">
                Control #{i + 1}: {ctrl?.substring(0, 30) || 'Sin contenido'}...
              </span>
              <div className="space-x-2">
                <button
                  onClick={() => setSelectedControl(i)}
                  className="text-blue-600 hover:underline text-sm"
                >
                  Ver Detalles
                </button>
                <button
                  onClick={() => handleDeleteControl(i)}
                  className="text-red-600 hover:underline text-sm"
                >
                  Eliminar
                </button>
              </div>
            </li>
          ))}
        </ul>
        <button
          className="mt-2 text-sm bg-blue-500 text-white px-3 py-1 rounded"
          onClick={handleAddControl}
        >
          Agregar control
        </button>
      </div>

      {/* BotÃ³n Guardar */}
      <div>
        <button
          className="text-sm bg-green-600 text-white px-4 py-2 rounded"
          onClick={handleSave}
        >
          Guardar cambios
        </button>
      </div>

      {/* Modal de ediciÃ³n de control */}
      {selectedControl !== null && (
        <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50">
          <div className="bg-white p-6 rounded shadow w-full max-w-md">
            <h4 className="font-semibold mb-2">Editar Control #{selectedControl + 1}</h4>
            <textarea
              className="w-full border rounded p-2 h-32"
              value={form.controles[selectedControl]}
              onChange={(e) => handleControlChange(selectedControl, e.target.value)}
            />
            <div className="mt-4 flex justify-between">
              <button
                onClick={() => handleDeleteControl(selectedControl)}
                className="px-4 py-2 bg-red-600 text-white rounded"
              >
                Eliminar
              </button>
              <button
                onClick={() => setSelectedControl(null)}
                className="px-4 py-2 bg-gray-600 text-white rounded"
              >
                Cerrar
              </button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default FichaOrtodoncia;
